import React from 'react';
import { Route, Switch } from 'react-router-dom';
import { Main } from './pages';
/**
 * @title Routes
 * @description Main Router
 */
const Routes = () => {
  return (
    <Switch>
      <Route path="/" component={Main} />
      <Route path="/User" component={User} />
    </Switch>
  );
};

export default Routes;
